import React from 'react';

import NavigationButton from './../../components/NavigationButton.js'
import BackButton from './../../components/BackButton.js'
import './Mode.css';

function Mode() {
  return (
    <div className="Mode-Landing">
        <div className="Mode-Opaque">
            <div className="Mode-Text">
                <BackButton link="/" text="BACK"/>
                <div className="Mode-Text-title">
                    Choose a mode.
                    </div>
                    <NavigationButton link="/begin" text="Assisted mode"/>
                    <NavigationButton link="/begin" text="Individual mode"/>
                <div className="Mode-Text-subtitle">
                    WHAT DOES THIS MEAN?
                </div>
            </div>
        </div>
    </div>
  );
}

export default Mode;
